create database uls_sd_g2_trab;
-- Prefixos:
-- ULS: Unilasalle
-- SD: Sistemas Distribuídos
-- SIS: Sistema
-- G2: Grau 2
-- Trab: Trabalho

use uls_sd_g2_trab;

create table sd_alunos (
	id int NOT NULL AUTO_INCREMENT,
    txNome Varchar(255) NOT NULL,
    dtNascimento Date NOT NULL,
    txGenero Varchar(255),
    txMatricula Varchar(9) NOT NULL,
    txCurso Varchar(255),
    dtMatricula Date NOT NULL,
    txStatusMatricula Varchar(20),
    txCep Varchar(9),
    txUF Varchar(2),
    txCidade Varchar(255),
    txRua Varchar(255),
    txNro Varchar(10),
    txFone1 Varchar(15),
    txFone2 Varchar(15),
    txEmail Varchar(255),
    txNomeMae Varchar(255),
    txNomePai Varchar(255),
    Primary Key(id),
    Unique(txMatricula)
);

